import React from "react";
import { NavLink } from "react-router-dom";

function Header() {
  return (
    <div className="grid-container">
      <header>
        <div>
          <NavLink to="/">Bways</NavLink>
        </div>
        <div>
          <NavLink to="/cart">Cart</NavLink>
          <NavLink to="/signin">Sign In</NavLink>
        </div>
      </header>
      <main>
        <ul>
          <li>product 1</li>
          <li>product 2</li>
          <li>product 3</li>
          <li>product 4</li>
        </ul>
      </main>
    </div>
  );
}

export default Header;
